const Articles = () => {

  const articles = [
    {id: 1, name: 'aaa'},
    {id: 2, name: 'bbb'},
    {id: 3, name: 'ccc'},
    {id: 4, name: 'ddd'},
    ];

  return (
    <div>
      <h2>Articles</h2>
      <div>
        {articles.length}
        {articles.map((article) => {
          <p>aaa {article.name}</p>
        })}
      </div>
    </div>
  )
};

export default Articles;
